import "./style.css";
import Header from "./Components/Header";

class Login extends Component{
    render(){
        return(
            <section>
                <Header />
                <div className="signin-and-signup">
                    <div id="bg-login" />
                    <div id="login">
                        <h1>Login</h1>
                        <label>Masukan nomor telepon atau email anda</label>
                        <input type="text" alt="" />
                        <div id="form-border"></div>
                        <button className="button-signin-and-signup" onclick="">Login</button>
                        <h4>Atau masuk dengan</h4>
                        <a className="api-login" href=""><img src="img/new-google-favicon-logo.png" className="button-api-login" alt="" />Google</a>
                        <a className="api-login" href=""><img src="img/facebook.png" className="button-api-login" alt="" />Facebook</a>
                        <h4>Belum punya akun?<a href="./daftar.html">Daftar</a></h4>
                    </div>
                </div>
            </section>
        );
    }
}

export default Login;
